1. Выбрать метод запроса **POST** и в теле запроса ввести 
**{
"firstname" : "Ira354*&^%",
"lastname" : "Gorobets8465 %%&*(",
"totalprice" : 120.78,
"depositpaid" : true,
"bookingdates" : {
"checkin" : "2023-03-01",
"checkout" : "2023-03-05"
},
"additionalneeds" : "Lunch564*%"?*"
}**

Expected Result:
В теле ответа отображается результат:

**{
    "bookingid": <newbooking_id>,
    "booking": {
        "firstname": "Ira354*&^%",
        "lastname": "Gorobets8465 %%&*(",
        "totalprice": 120.78,
        "depositpaid": true,
        "bookingdates": {
            "checkin": "2023-03-01",
            "checkout": "2023-03-05"
        },
        "additionalneeds": "Lunch564*%"?*"
    }
}**

Код состояния HTTP 200
